import React, { FC } from "react";
import { WidthContainer } from "../../components/width-container/width-container";
import logo from "../../fjellerup-kro-logo.png";

import './header.scss';

export const Header: FC = () => {
    return (
        <header className="header">
            <WidthContainer className="header__container">
                <img src={logo} className="header__logo" alt="logo" />
                <h1 className="header__title">Lottes kro</h1>
                <div className="header__menu">
                    <li className="header__menu__option"><a href="">Restuarant</a></li>
                    <li className="header__menu__option"><a href="">Galleri</a></li>
                    <li className="header__menu__option"><a href="">Kontakt Os</a></li>
                    <li className="header__menu__option"><a href="">Om Kro'en</a></li>
                </div>
            </WidthContainer>
        </header>
    );
};
